/*#include "dbg_print.h" */
#define print_err(fmt, ...) \
	do {\
		pr_err("%s: ", FILTER_NAME); pr_err(fmt, ##__VA_ARGS__);  \
	} while (0)

static UINT sl_get_sequence_id(UINT base_id, UINT width)
{
	UINT current_sequence_id;
	if (width == 0) {
		current_sequence_id = base_id * 10;
	} else {
		current_sequence_id = (base_id * 10) + ((width - 1) >> 7);
	}
	return current_sequence_id;
}

static SINT sl_set_parameter(FILTER_PARAMETER *parameter, FILTER_DESCRIPT *descript, UINT current_sequence_id, UINT dst_physmem_addr,	/* Vis2: void *dst_physmem_vaddr, */
			     UINT width, UINT height, UINT dst_pitch, FILTER_BIT_ACC out_channel_bit_accuracy, UINT src_physmem_addr,	/* Vis2: void* src_physmem_vaddr, */
			     UINT src_pitch,
			     FILTER_BIT_ACC in_channel_bit_accuracy)
{
	UINT i = 0;
	UINT in_line_offset, out_line_offset;
	UINT dst_paddr, src_paddr;

#if 0				/* Vis2 */
	/* convert physmem address */
	src_paddr = osdep_physmem_vaddr_to_paddr(src_physmem_vaddr);
	dst_paddr = osdep_physmem_vaddr_to_paddr(dst_physmem_vaddr);
	if ((src_paddr == 0) || (dst_paddr == 0)) {
		print_err("cannot convert physmem address\n");
		return -1;
	}
#else
	src_paddr = src_physmem_addr;
	dst_paddr = dst_physmem_addr;
#endif

	in_line_offset = (in_channel_bit_accuracy == FILTER_BITACC_U8) ?
	    (src_pitch - width) : ((src_pitch - width) * 2);
	out_line_offset = (out_channel_bit_accuracy == FILTER_BITACC_U8) ?
	    (dst_pitch - width) : ((dst_pitch - width) * 2);

	parameter->sequence_id = current_sequence_id;
	parameter->frame_num = 1;

	parameter->width = (USHORT)width;
	parameter->height = (USHORT)height;

	parameter->in_channel_num = 1;
	parameter->in_channel_info[0].addr = src_paddr;
	parameter->in_channel_info[0].ratio = FILTER_RATIO_1HV;
	parameter->in_channel_info[0].bit_accuracy = in_channel_bit_accuracy;
	parameter->in_channel_info[0].line_offset = in_line_offset;
	parameter->out_channel_num = 1;
	parameter->out_channel_info[0].addr = dst_paddr;
	parameter->out_channel_info[0].ratio = FILTER_RATIO_1HV;
	parameter->out_channel_info[0].bit_accuracy = out_channel_bit_accuracy;
	parameter->out_channel_info[0].line_offset = out_line_offset;

	for (i = 1; i < 4; i++) {
		descript->image_set[i * 2].initaddr = 0;
		descript->image_set[i * 2].ratiooffset = 0;
		descript->image_set[(i * 2) + 1].initaddr = 0;
		descript->image_set[(i * 2) + 1].ratiooffset = 0;
	}
	parameter->hif_param_num = 0;
	parameter->hif_param = NULL;
	return 0;
}

static SINT sl_set_hif_parameter(struct filter_dev *dev,
				 FILTER_HIF_PARAM *p_hif_param,
				 UINT target_seq_id, UINT hif_addr,
				 SSHORT param_data)
{
	SINT ret = 0;
	p_hif_param->addr =
	    (SSHORT *)dd_FILTER_get_HIF_address(dev, (SINT) target_seq_id,
						hif_addr);
	p_hif_param->data = param_data;
	if (p_hif_param->addr == NULL) {
		print_err("error at dd_FILTER_get_HIF_address\n");
		ret = -1;
	}
	return ret;
}

/* ====================================================================== */

static SINT sl_sobel_direction3x3_setparam(struct filter_dev *dev,
					   FILTER_PARAMETER *parameter,
					   FILTER_HIF_PARAM *p_hif_param,
					   USHORT threshold, USHORT width)
{
	SINT ret = 0;
	UINT target_seq_id = (UINT)parameter->sequence_id;

	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 0, target_seq_id, 0x861b,
				 threshold);
	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 1, target_seq_id, 0x869b,
				 threshold);
	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 2, target_seq_id, 0x8620,
				 width);
	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 3, target_seq_id, 0x86a0,
				 width);

	if (ret != 0) {
		print_err("error at sl_set_hif_parameter(%d)\n", ret);
		return -1;
	}
	return 0;
}

/*
 * Note: Valid output image is from VBGN to VEND in dst_paddr.
 *       Currently outer area of VBGN/VEND are not modified.
 *       See C-ViA BusIF document for VBGN/VEND.
 */

SINT sl_sobel_direction3x3(struct filter_dev *dev,
			   ULONG dst_physmem_addr,
			   ULONG src_physmem_addr,
			   UINT width, UINT height, UINT pitch,
			   USHORT threshold)
{
	FILTER_PARAMETER parameter;
	FILTER_DESCRIPT descript;
	FILTER_HIF_PARAM hif_param[4];
	UINT target_sequence_id;
	SINT ret = 0;
	UINT blank_line = 1;	/* set VBGN value in direction3x3_*.hif */
#if 0				/* Vis2 */
	VOID *filter_dst_vaddr = dst_physmem_vaddr + (pitch * blank_line);
#else
	UINT filter_dst_addr = dst_physmem_addr + (pitch * blank_line);
#endif

	memset(&descript, 0, sizeof(descript));
	target_sequence_id =
	    sl_get_sequence_id(THGR3_VIS2_FW_FILTER_SEQUENCE_direction3x3,
			       width);
	ret =
	    sl_set_parameter(&parameter, &descript, target_sequence_id,
			     filter_dst_addr, width, height, pitch,
			     FILTER_BITACC_U8, src_physmem_addr, pitch,
			     FILTER_BITACC_U8);
	if (ret != 0) {
		print_err("error at sl_set_parameter\n");
		return ret;
	}

	ret =
	    sl_sobel_direction3x3_setparam(dev, &parameter, hif_param,
					   threshold, (USHORT)width);
	if (ret != 0) {
		print_err("error at sl_sobel_direction3x3_setparam(%d)\n", ret);
		return ret;
	}
	parameter.hif_param_num = sizeof(hif_param) / sizeof(hif_param[0]);
	parameter.hif_param = hif_param;

	ret = dd_FILTER_config_param(dev, &descript, &parameter);
	if (ret != 0) {
		print_err("error at dd_FILTER_config_param(%d)\n", ret);
		return ret;
	}

	ret = dd_FILTER_send_request(dev, &descript);
	if (ret != 0) {
		print_err("error at dd_FILTER_send_request(%d)\n", ret);
		return ret;
	}

	return 0;
}

/* ====================================================================== */
static SINT sl_sobel_direction3x3_and_intensity_setparam(struct filter_dev *dev,
							 FILTER_PARAMETER
							 *parameter,
							 FILTER_HIF_PARAM
							 *p_hif_param,
							 USHORT width)
{
	SINT i;
	SINT ret = 0;
	UINT target_seq_id = (UINT)parameter->sequence_id;
	const UINT hif_addr_list[4] = {
		0x861c,
		0x869c,
		0x8620,
		0x86a0
	};

	for (i = 0; i < 4; i++) {
		ret =
		    sl_set_hif_parameter(dev, p_hif_param + i, target_seq_id,
					 hif_addr_list[i], width);
		if (ret != 0) {
			print_err("error at sl_set_hif_parameter(%d)\n", ret);
			return -1;
		}
	}
	return 0;
}

SINT sl_sobel_direction3x3_and_intensity(struct filter_dev *dev,
					 ULONG dst_dir_physmem_addr,
					 ULONG dst_int_physmem_addr,
					 ULONG src_physmem_addr,
					 UINT width, UINT height, UINT pitch)
{
	FILTER_PARAMETER parameter;
	FILTER_DESCRIPT descript;
	UINT target_sequence_id;
	SINT ret = 0;
	UINT blank_line = 1;	/* set VBGN value in direction3x3_*.hif */
	FILTER_HIF_PARAM hif_param[4];

	UINT filter_dst_dir_addr = dst_dir_physmem_addr + (pitch * blank_line);
	UINT filter_dst_int_addr =
	    dst_int_physmem_addr + (pitch * blank_line) * 2;
	UINT out_line_offset_s16 = (pitch - width) * 2;

	memset(&descript, 0, sizeof(descript));
	target_sequence_id =
	    sl_get_sequence_id
	    (THGR3_VIS2_FW_FILTER_SEQUENCE_direction3x3_and_intensity, width);
	ret =
	    sl_set_parameter(&parameter, &descript, target_sequence_id,
			     filter_dst_dir_addr, width, height, pitch,
			     FILTER_BITACC_U8, src_physmem_addr, pitch,
			     FILTER_BITACC_U8);
	if (ret != 0) {
		print_err("error at sl_set_parameter\n");
		return ret;
	}

	ret =
	    sl_sobel_direction3x3_and_intensity_setparam(dev, &parameter,
							 hif_param,
							 (USHORT)width);
	if (ret != 0) {
		print_err
		    ("error at sl_sobel_direction3x3_and_intensity_setparam(%d)\n",
		     ret);
		return ret;
	}
	parameter.hif_param_num = sizeof(hif_param) / sizeof(hif_param[0]);
	parameter.hif_param = hif_param;

	/* update parameter for output channel 1 */
	parameter.out_channel_num = 2;
	parameter.out_channel_info[1].addr = filter_dst_int_addr;
	parameter.out_channel_info[1].ratio = FILTER_RATIO_1HV;
	parameter.out_channel_info[1].bit_accuracy = FILTER_BITACC_S16;
	parameter.out_channel_info[1].line_offset = out_line_offset_s16;

	ret = dd_FILTER_config_param(dev, &descript, &parameter);
	if (ret != 0) {
		print_err("error at dd_FILTER_config_param(%d)\n", ret);
		return ret;
	}

	ret = dd_FILTER_send_request(dev, &descript);
	if (ret != 0) {
		print_err("error at dd_FILTER_send_request(%d)\n", ret);
		return ret;
	}

	return 0;
}

/* ====================================================================== */

static SINT sl_sobel_direction3x3_and_intensity_with_threshold_setparam(struct
									filter_dev
									*dev, FILTER_PARAMETER
									*parameter, FILTER_HIF_PARAM
									*p_hif_param,
									USHORT
									threshold,
									USHORT
									width)
{
	SINT ret = 0;
	UINT target_seq_id = (UINT)parameter->sequence_id;

	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 0, target_seq_id, 0x8626,
				 threshold);
	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 1, target_seq_id, 0x86a6,
				 threshold);

	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 2, target_seq_id, 0x8628,
				 width);
	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 3, target_seq_id, 0x86a8,
				 width);
	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 4, target_seq_id, 0x8630,
				 width);
	ret +=
	    sl_set_hif_parameter(dev, p_hif_param + 5, target_seq_id, 0x86b0,
				 width);
	if (ret != 0) {
		print_err("error at sl_set_hif_parameter(%d)\n", ret);
		return -1;
	}
	return 0;
}

/*
 * Note: Valid output image is from VBGN to VEND in dst_paddr.
 *       Currently outer area of VBGN/VEND are not modified.
 *       See C-ViA BusIF document for VBGN/VEND.
 */

SINT sl_sobel_direction3x3_and_intensity_with_threshold(struct filter_dev *dev,
							ULONG
							dst_dir_physmem_addr,
							ULONG
							dst_dir_nothr_physmem_addr,
							ULONG
							dst_int_physmem_addr,
							ULONG src_physmem_addr,
							UINT width, UINT height,
							UINT pitch,
							USHORT threshold)
{
	FILTER_PARAMETER parameter;
	FILTER_DESCRIPT descript;
	FILTER_HIF_PARAM hif_param[6];
	UINT target_sequence_id;
	SINT ret = 0;
	UINT blank_line = 1;	/* set VBGN value in direction3x3_*.hif */

	UINT filter_dst_dir_addr = dst_dir_physmem_addr + (pitch * blank_line);
	UINT filter_dst_dir_nothr_addr =
	    dst_dir_nothr_physmem_addr + (pitch * blank_line);
	UINT filter_dst_int_addr =
	    dst_int_physmem_addr + (pitch * blank_line) * 2;
	UINT out_line_offset_u8 = pitch - width;
	UINT out_line_offset_s16 = (pitch - width) * 2;

	memset(&descript, 0, sizeof(descript));
	target_sequence_id =
	    sl_get_sequence_id
	    (THGR3_VIS2_FW_FILTER_SEQUENCE_direction3x3_and_intensity_with_threshold,
	     width);
	ret =
	    sl_set_parameter(&parameter, &descript, target_sequence_id,
			     filter_dst_dir_addr, width, height, pitch,
			     FILTER_BITACC_U8, src_physmem_addr, pitch,
			     FILTER_BITACC_U8);
	if (ret != 0) {
		print_err("error at sl_set_parameter\n");
		return ret;
	}

	/* update parameter for output channel 1, 2 */
	parameter.out_channel_num = 3;
	parameter.out_channel_info[1].addr = filter_dst_dir_nothr_addr;
	parameter.out_channel_info[1].ratio = FILTER_RATIO_1HV;
	parameter.out_channel_info[1].bit_accuracy = FILTER_BITACC_U8;
	parameter.out_channel_info[1].line_offset = out_line_offset_u8;

	parameter.out_channel_info[2].addr = filter_dst_int_addr;
	parameter.out_channel_info[2].ratio = FILTER_RATIO_1HV;
	parameter.out_channel_info[2].bit_accuracy = FILTER_BITACC_S16;
	parameter.out_channel_info[2].line_offset = out_line_offset_s16;

	ret =
	    sl_sobel_direction3x3_and_intensity_with_threshold_setparam(dev,
									&parameter,
									hif_param,
									threshold,
									(USHORT)
									width);
	if (ret != 0) {
		print_err
		    ("error at sl_sobel_direction3x3_and_intensity_with_threshold_setparam(%d)\n",
		     ret);
		return ret;
	}
	parameter.hif_param_num = sizeof(hif_param) / sizeof(hif_param[0]);
	parameter.hif_param = hif_param;

	ret = dd_FILTER_config_param(dev, &descript, &parameter);
	if (ret != 0) {
		print_err("error at dd_FILTER_config_param(%d)\n", ret);
		return ret;
	}

	ret = dd_FILTER_send_request(dev, &descript);
	if (ret != 0) {
		print_err("error at dd_FILTER_send_request(%d)\n", ret);
		return ret;
	}

	return 0;
}

