SINT sl_average_image(struct filter_dev *dev,
		      ULONG dst_16bit_physmem_addr,
		      ULONG dst_8bit_physmem_addr,
		      ULONG src_physmem_addr,
		      UINT width, UINT height, UINT src_pitch, UINT dst_pitch)
{
	FILTER_PARAMETER parameter;
	FILTER_DESCRIPT descript;
	UINT target_sequence_id;
	UINT dst_16bit_paddr, dst_8bit_paddr, src_paddr;
	UINT in_line_offset, out_line_offset;
	UINT out_line_offset_u8;
	SINT ret = 0;
	UINT i;

#if 0				/* Vis2 */
	src_paddr = osdep_physmem_vaddr_to_paddr(src_physmem_vaddr);
	dst_paddr = osdep_physmem_vaddr_to_paddr(dst_physmem_vaddr);
#else
	src_paddr = src_physmem_addr;
	dst_16bit_paddr = dst_16bit_physmem_addr;
	dst_8bit_paddr = dst_8bit_physmem_addr;
#endif

	in_line_offset = src_pitch - width;
	out_line_offset = (dst_pitch - width) * 2;
	out_line_offset_u8 = dst_pitch - width;

	memset(&descript, 0, sizeof(descript));
	target_sequence_id =
	    sl_get_sequence_id(THGR3_VIS2_FW_FILTER_SEQUENCE_average_image,
			       width);

	/* set parameter */
	parameter.sequence_id = target_sequence_id;
	parameter.hif_param_num = 0;
	parameter.hif_param = NULL;
	parameter.frame_num = 1;
	parameter.width = width;
	parameter.height = height;

	parameter.in_channel_num = 2;
	parameter.in_channel_info[0].addr = src_paddr;
	parameter.in_channel_info[0].ratio = FILTER_RATIO_1HV;
	parameter.in_channel_info[0].bit_accuracy = FILTER_BITACC_U8;
	parameter.in_channel_info[0].line_offset = in_line_offset;

	parameter.in_channel_info[1].addr = dst_16bit_paddr;
	parameter.in_channel_info[1].ratio = FILTER_RATIO_1HV;
	parameter.in_channel_info[1].bit_accuracy = FILTER_BITACC_S16;
	parameter.in_channel_info[1].line_offset = out_line_offset;

	parameter.out_channel_num = 2;
	parameter.out_channel_info[0].addr = dst_16bit_paddr;
	parameter.out_channel_info[0].ratio = FILTER_RATIO_1HV;
	parameter.out_channel_info[0].bit_accuracy = FILTER_BITACC_S16;
	parameter.out_channel_info[0].line_offset = out_line_offset;

	parameter.out_channel_info[1].addr = dst_8bit_paddr;
	parameter.out_channel_info[1].ratio = FILTER_RATIO_1HV;
	parameter.out_channel_info[1].bit_accuracy = FILTER_BITACC_U8;
	parameter.out_channel_info[1].line_offset = out_line_offset_u8;

	for (i = 1; i < 4; i++) {
		descript.image_set[i * 2].initaddr = 0;
		descript.image_set[i * 2].ratiooffset = 0;
		descript.image_set[(i * 2) + 1].initaddr = 0;
		descript.image_set[(i * 2) + 1].ratiooffset = 0;
	}

	ret = dd_FILTER_config_param(dev, &descript, &parameter);
	if (ret != 0) {
		print_err("error at dd_FILTER_config_param(%d)\n", ret);
		return ret;
	}

	ret = dd_FILTER_send_request(dev, &descript);
	if (ret != 0) {
		print_err("error at dd_FILTER_send_request(%d)\n", ret);
		return ret;
	}

	return 0;
}

