static SINT sl_correct_color_setparam(struct
				      filter_dev
				      *dev, FILTER_PARAMETER
				      *parameter, FILTER_HIF_PARAM
				      *p_hif_param, UINT color_rate)
{
	SINT ret = 0;
	UINT target_seq_id = (UINT)parameter->sequence_id;
	const UINT hif_addr_list[6] = {
		0x8604,
		0x8684,

		0x862e,
		0x86ae,

		0x8632,
		0x86b2
	};
	SINT i;

	for (i = 0; i < (sizeof(hif_addr_list) / sizeof(hif_addr_list[0])); i++) {
		ret =
		    sl_set_hif_parameter(dev, p_hif_param + i, target_seq_id,
					 hif_addr_list[i], color_rate);
		if (ret != 0) {
			print_err("error at sl_set_hif_parameter(%d)\n", ret);
			return -1;
		}
	}
	return 0;
}

SINT sl_correct_color(struct filter_dev *dev,
		      ULONG src_y_physmem_addr,
		      ULONG src_u_physmem_addr,
		      ULONG src_v_physmem_addr,
		      ULONG src_tonemapped_y_physmem_addr,
		      ULONG dst_u_physmem_addr,
		      ULONG dst_v_physmem_addr,
		      UINT width, UINT height, UINT pitch, UINT color_rate)
{
	FILTER_PARAMETER parameter;
	FILTER_DESCRIPT descript;
	FILTER_HIF_PARAM hif_param[6];
	UINT target_sequence_id;
	UINT src_y_paddr, src_u_paddr, src_v_paddr, src_tonemapped_y_paddr;
	UINT dst_u_paddr, dst_v_paddr;
	UINT in_line_offset, out_line_offset;
	SINT ret = 0;
	UINT i;

#if 0				/* Vis2 */
	/* none */
#else
	src_y_paddr = src_y_physmem_addr;
	src_u_paddr = src_u_physmem_addr;
	src_v_paddr = src_v_physmem_addr;
	src_tonemapped_y_paddr = src_tonemapped_y_physmem_addr;
	dst_u_paddr = dst_u_physmem_addr;
	dst_v_paddr = dst_v_physmem_addr;
#endif

	in_line_offset = pitch - width;
	out_line_offset = pitch - width;

	memset(&descript, 0, sizeof(descript));

	if (width <= 1280) {
		target_sequence_id =
		    sl_get_sequence_id
		    (THGR3_VIS2_FW_FILTER_SEQUENCE_correct_color, width);
	} else {
		target_sequence_id =
		    sl_get_sequence_id
		    (THGR3_VIS2_FW_FILTER_SEQUENCE_correct_color_1408,
		     width - 1280);
	}

	/* set parameter */
	parameter.sequence_id = target_sequence_id;
	parameter.hif_param_num = sizeof(hif_param) / sizeof(hif_param[0]);
	parameter.hif_param = hif_param;
	parameter.frame_num = 1;
	parameter.width = width;
	parameter.height = height;

	parameter.in_channel_num = 4;
	parameter.in_channel_info[0].addr = src_y_paddr;
	parameter.in_channel_info[0].ratio = FILTER_RATIO_1HV;
	parameter.in_channel_info[0].bit_accuracy = FILTER_BITACC_U8;
	parameter.in_channel_info[0].line_offset = in_line_offset;

	parameter.in_channel_info[1].addr = src_u_paddr;
	parameter.in_channel_info[1].ratio = FILTER_RATIO_1HV;
	parameter.in_channel_info[1].bit_accuracy = FILTER_BITACC_U8;
	parameter.in_channel_info[1].line_offset = in_line_offset;

	parameter.in_channel_info[2].addr = src_v_paddr;
	parameter.in_channel_info[2].ratio = FILTER_RATIO_1HV;
	parameter.in_channel_info[2].bit_accuracy = FILTER_BITACC_U8;
	parameter.in_channel_info[2].line_offset = in_line_offset;

	parameter.in_channel_info[3].addr = src_tonemapped_y_paddr;
	parameter.in_channel_info[3].ratio = FILTER_RATIO_1HV;
	parameter.in_channel_info[3].bit_accuracy = FILTER_BITACC_U8;
	parameter.in_channel_info[3].line_offset = in_line_offset;

	parameter.out_channel_num = 2;
	parameter.out_channel_info[0].addr = dst_u_paddr;
	parameter.out_channel_info[0].ratio = FILTER_RATIO_1HV;
	parameter.out_channel_info[0].bit_accuracy = FILTER_BITACC_U8;
	parameter.out_channel_info[0].line_offset = out_line_offset;

	parameter.out_channel_info[1].addr = dst_v_paddr;
	parameter.out_channel_info[1].ratio = FILTER_RATIO_1HV;
	parameter.out_channel_info[1].bit_accuracy = FILTER_BITACC_U8;
	parameter.out_channel_info[1].line_offset = out_line_offset;

	for (i = 1; i < 4; i++) {
		descript.image_set[i * 2].initaddr = 0;
		descript.image_set[i * 2].ratiooffset = 0;
		descript.image_set[(i * 2) + 1].initaddr = 0;
		descript.image_set[(i * 2) + 1].ratiooffset = 0;
	}

	/* HIF param */
	ret = sl_correct_color_setparam(dev, &parameter, hif_param, color_rate);
	if (ret != 0) {
		print_err("error at sl_correct_color_setparam(%d)\n", ret);
		return ret;
	}

	ret = dd_FILTER_config_param(dev, &descript, &parameter);
	if (ret != 0) {
		print_err("error at dd_FILTER_config_param(%d)\n", ret);
		return ret;
	}

	ret = dd_FILTER_send_request(dev, &descript);
	if (ret != 0) {
		print_err("error at dd_FILTER_send_request(%d)\n", ret);
		return ret;
	}

	return 0;
}

